            headers: {
              Authorization: "Bearer DVRz32O6REDwuxl07s_SQQ",
            },
          });
          setPosts(response.formData.data.children);
        } catch (error) {
          console.error("Error fetching data");
        }
      };

      fetchData();
    }, []);

    console.log(posts);

